.question {
  width: 100%;
  outline: 1px solid cyan;

  &__title {
    margin-bottom: 41px;
    font-weight: 400;
    font-size: 20px;
    line-height: calc(26 / 20);
    text-align: center;
    letter-spacing: 0.05em;
    // text-transform: capitalize;
  }

  &__wrap {
    display: grid;
    grid-template-columns: 1fr;
    grid-auto-rows: 50px;
    row-gap: 8px;

    &--wide {
      grid-auto-rows: 78px;
    }
  }

  &__answer {
    width: 100%;
    height: 100%;

    &-wrap {
      padding-left: 35px;
      display: flex;
      justify-content: flex-start;
      align-items: center;
      width: 100%;
      height: 100%;
      font-size: 18px;
      line-height: calc(58 / 18);
      letter-spacing: 0.05em;
      text-transform: capitalize;
      background-color: rgba($testTrackBgColor, 0.15);

      &--wide {       
        font-size: 18px;
        line-height: calc(20 / 18);
        letter-spacing: 0.05em;
      }
    }

    &-icon {
      margin-right: 39px;
      display: block;
      width: 20px;
      height: 20px;
      border-radius: 50%;
      background-color: transparent;
      border: 1px solid $mainColor;
      @include myTransition(background-color);

      &--wide {
        margin-right: 15px;
      }
    }

    &-input:checked + &-wrap {
      background-color: $accentColor;
    }

    &-input:checked + &-wrap > &-icon {
      background-color: $checkedBoxColor;
    }

    &-input:checked + &-wrap > &-text {
      color: $secondaryColor;
    }
  }

  &-colors {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }

  &__colors {
    &-wrap {
      display: grid;
      grid-template-columns: repeat(3, 75px);
      grid-auto-rows: 75px;
      row-gap: 24px;
      column-gap: 21px;
    }

    &-answer {
      width: 100%;
      height: 100%;

      &:nth-child(1) &-square {
        background-color: #a8a8a8;
      }
      &:nth-child(2) &-square {
        background-color: #0000a9;
      }
      &:nth-child(3) &-square {
        background-color: #00a701;
      }
      &:nth-child(4) &-square {
        background-color: #f60100;
      }
      &:nth-child(5) &-square {
        background-color: #fdff19;
      }
      &:nth-child(6) &-square {
        background-color: #a95403;
      }
      &:nth-child(7) &-square {
        background-color: #000000;
      }
      &:nth-child(8) &-square {
        background-color: #850068;
      }
      &:nth-child(9) &-square {
        background-color: #46b3ac;
      }
    }

    &-answer-square {
      display: block;
      width: 100%;
      height: 100%;
      @include myTransition(border);
    }

    &-answer-input:checked + &-answer-square {
      border: 6px solid $accentColor;
    }
  }

  &-boxes {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }

  &__boxes {
    &-picture {
      margin-bottom: 26px;
    }

    &-wrap {
      display: flex;
    }

    &-answer:not(:last-child) {
      margin-right: 29px;
    }

    &-answer-wrap {
      display: flex;
      justify-content: center;
      align-items: center;
      width: 41px;
      height: 41px;

      font-size: 20px;
      line-height: calc(49 / 20);
      text-transform: capitalize;

      color: $btnTextColor;
      background-color: $mainColor;
    }

    &-answer-input:checked + &-answer-wrap {
      border: 6px solid $accentColor;
    }
  }
}
